import React from 'react';
import { useState } from 'react';
import list_icon from "../../../Assets/UI Icons/list.svg"
import './list_menu.scss';

function ListMenu() {
    const [clicked, setClicked] = useState(false);


    return <button id="list_button"><img id="list_image" src={list_icon} alt="button to open a navigation list for movies and actors" className="filter-white" /></button>
}

// Icons made by <a href="https://www.flaticon.com/authors/freepik" title="Freepik">Freepik</a> from <a href="https://www.flaticon.com/" title="Flaticon">www.flaticon.com</a></div>

export default ListMenu;
